INSERT INTO RECIPE (ID, NAME, DURATION, DESCRIPTION, TAGS, DELETED) VALUES (41, 'Roast salmon', 35, 'Heat oven to 160C/140C fan/gas 4. To make the crumble, mix the crumbs, onion flakes, herbs, horseradish, 1 tsp salt and melted butter together, then set aside. Line a baking tray with baking parchment, scatter over the sliced onions and drizzle with olive oil. Sprinkle with a little salt and lay the salmon on top, skin-side up. Loosely pack over the crumble mix. Roast in the oven for 20 mins, or until just cooked through.&#10;While the fish is cooking, blanch the kale in boiling water for 2 mins, drain and refresh under cold water. Put the kale, garlic, lemon zest, and oil in a food processor and blend to a coarse salsa. Season to taste.&#10;Once the fish is cooked, remove from the oven and leave to rest for 5 mins. Pull apart into large chunks and serve with onions, salsa and sour cream.', 'D', false);
