INSERT INTO RECIPE (ID, NAME, DURATION, DESCRIPTION, TAGS, DELETED) VALUES (42, 'Scrambled eggs & smoked salmon', 12, 'Beat together the eggs, milk and some seasoning in a jug. Heat the oil in a large non-stick pan over a low heat and pour in the egg mix. Cook, stirring, until it is done around the edges and slightly runny in the middle. Then tip in the tomatoes and warm through for 1 min until the eggs have finished cooking.&#10;Top the toast with the scrambled eggs and chives, and place the smoked salmon on the side with a wedge of lemon to squeeze over.', 'L', false);
