INSERT INTO RECIPE (ID, NAME, DURATION, DESCRIPTION, TAGS, DELETED) VALUES (45, 'Tuna melt potato wedges', 35, 'Heat oven to 220c/fan 200c/gas 6. Tip the potato wedges onto a large baking sheet, ensuring they sit in a single layer. Bake for 10 mins. Meanwhile, mix together the mayonnaise, shallot or onion, cheese, tuna and parsley.&#10;Tip the potato wedges into four individual or one large heatproof serving dish and spoon over the tuna mixture. Pop back in the oven for a further 12 mins, until bubbling.', 'D', false);
