INSERT INTO RECIPE (ID, NAME, DURATION, DESCRIPTION, TAGS, DELETED) VALUES (46, 'Tuna & lemon pasta', 25, 'Cook the pasta in boiling salted water for 8 minutes. Add the beans and cook for a further 3 minutes until both the pasta and beans are just tender. Meanwhile, tip the tuna and its oil into a bowl and flake the fish, keeping the pieces quite large. Stir in the lemon zest, capers, chilli and plenty of salt and pepper.&#10;Drain the pasta and beans, return them to the pan and toss with the tuna mixture. Add a little olive oil if you need to moisten everything. Serve the tuna and lemon pasta on its own or with a tomato and onion salad.', 'L', false);
