INSERT INTO RECIPE (ID, NAME, DURATION, DESCRIPTION, TAGS, DELETED) VALUES (57, 'Broccoli & sage pasta', 17, 'Boil the spaghetti for 1 min. Add the broccoli and cook for 4 mins more.&#10;Meanwhile, heat the oil in a frying pan and add the shallots and garlic. Gently cook for 5 mins until golden. Add the chillies and sage to the pan and gently cook for 2 mins. Drain the pasta, mix with the shallot mixture in the pan, then scatter with Parmesan, if you like.', 'D', false);
