INSERT INTO RECIPE (ID, NAME, DURATION, DESCRIPTION, TAGS, DELETED) VALUES (59, 'Pizza pasta salad', 25, 'Cook the pasta following pack instructions. Drain, rinse under cold water to cool, then drain well. Toss with the oil and sundried tomato pesto, season to taste. Place in a jar or plastic box and scatter over the remaining ingredients in layers, ending with the basil.', 'D', false);
