INSERT INTO RECIPE(ID, NAME, DURATION, DESCRIPTION, TAGS, DELETED) VALUES(90, 'Strawberry labneh', 20, 'Mix the yogurt with a pinch of salt. Line a sieve with muslin and sit over a deep bowl. Spoon in the yogurt and put in the fridge to strain for 4 hrs.\n\nMeanwhile, hull and quarter the strawberries, mix them with the sugar and rosewater and leave to macerate.\n\nAfter 4 hrs, turn the labneh out into a clean bowl. Gently fold through the honey. Take \u00bc of the strawberries and pur\u00e9e them in a blender, then fold into the labneh, so you have a rippled yogurt. Serve in glass bowls with the rest of the strawberries on top, scatter with pistachios, and serve with the pistachio & coriander seed biscuits on the side.', 0, FALSE);
