INSERT INTO RECIPE(ID, NAME, DURATION, DESCRIPTION, TAGS, DELETED) VALUES(91, 'Summer beans on toast with prosciutto', 20, 'Heat a medium-sized pan of water until boiling, and heat a griddle pan over a high heat. Add the broad beans and green beans to the boiling water. Cook for 2 mins or until just tender, then drain and remove the broad bean skins, if you like. Mix the vegetables with the pesto.\n\nMeanwhile, drizzle the cut side of the ciabatta with a little oil, then rub with the squashed garlic. Place, oiled-side down, in the griddle pan. Toast until charred griddle lines appear \u2013 about 2 mins.\n\nPlace a piece of toasted ciabatta on each plate, spread with the cream cheese, then top with the pesto veg, a slice of prosciutto and a handful of rocket leaves. Drizzle with some more olive oil and serve.', 6, FALSE);
